import React, { Component } from "react";
import { Link } from 'react-router-dom';
import axios from 'axios';
import CarTableRow from './CarTableRow';


export default class CarList extends Component 
{
  constructor(props) 
  {
    super(props)
    this.state = {
         cars: []
         };
         dataTable;
  }


  dataTable() {

       axios.get('http://localhost:4000/toyota/')
      .then(res => {
        this.setState({
          cars: res.data
        });

                console.log(res.data)

      })
      .catch((error) => {
        console.log(error);
      })

 //   return this.state.cars.map(car => {
   //   return <CarTableRow obj={car} key={car._id} />;
  //  });
  }


  render() {
    return (<div className="table-container">
      <table>
        <thead>
          <tr>
            <th>Model</th>
            <th>Colour</th>
            <th>Year</th>
            <th>Price</th>
            <th>&nbsp;</th>
          </tr>
        </thead>
        <tbody>
        {this.state.cars.map(car => <CarTableRow obj={car} key={car._id} />)}

        </tbody>
      </table>
      <div className="add-new-car">
      <Link className="blue-button" to={"/AddCar"}>
        Add New Car
      </Link>
      </div>

    </div>);
  }
}
